      <div className='social-auth-box'>
        <div className='social-auth-item'>
           <h1>Socialbook</h1>
        </div>
        <div className='social-auth-item'>
           <p>Verification</p>
        </div>
        <div className='social-auth-item'>
           <input type='otp'/>
        </div>
        <div className='social-auth-item'>
          
          <button type='button'>Verify</button>
          
          
        </div>

      </div>

    </div>
  )
}

export default Verify;
